import "./App.css";
import Header from "./Header";
import Home from "./Home";
import {BrowserRouter as Router , Switch ,Route}
from "react-router-dom";

function App() {
  return (
    //BEM
    <Router>
      <div className="app">
      <switch>
        <Route path="/">
          <Header />
          <Home />
        </Route>
   </switch>

  </div>
  </Router>

  );
}

export default App;
